    });
  };

  redner() {
    return (
      <div className="App">
        <header className="App-header">
          <TabSwitchContainer onChange={this.handleTabChange}>
            <TotalsContainer />
            <AveragesContainer />
            {this.state.tab}
          </TabSwitchContainer>
          <img src={logo} className="App-logo" alt="logo" />
